import React, { useState, useEffect } from 'react'
import { Link } from 'react-router-dom'
import { useLocation } from 'react-router'
import axios from 'axios'
import { Baseurl } from '../../baseurl'


const Wishlists = () => {
    let path = useLocation()
    const [details, setDetails] = useState([])
    const [isFetching, setFecthing] = useState(false)

    useEffect(() => {
        setFecthing(true)
        let token = sessionStorage.Token
        axios.get(`${Baseurl}wishlist`, {
            headers: {
                'Authorization': 'Bearer' + token
            }
        }).then((res) => {
            setFecthing(false)
            if (res.data) {
                setDetails(res.data)
            }
        }).catch((error) => {
            setFecthing(false)
            if (error.response.status === 500) {
                sessionStorage.setItem('Path', path.pathname)
            }
        })
    }, [])
    return (
        <>
            <section className="about container-fluid mt-4 mx-auto" id="about">
                <div class="row">
                    {details.length ? <small style={{ color: '#0D826E' }}><strong>Wishlists</strong></small> : ''}
                   {}
                </div>

            </section>
        </>
    )
}

export default Wishlists
